import React from 'react'
import EventsList from '../components/EventsList'
import { Link } from 'react-router-dom';

const DUMMY_EVENTS = [
  { id: "e1", title: "event 1" },
  { id: "e2", title: "event 2" },
  { id: "e3", title: "event 3" },
];

const Eventspage = () => {
  return (
    <div>
      <h1>All Events</h1>
      <ul className={classes.list}>
        {DUMMY_EVENTS.map((event) => (
          <li key={event.id} >
            <Link to={`events/${event.id}`} >
              {event.title}
            </Link>
          </li>
        ))}
      </ul>
    </div>
  )
}

export default Eventspage
